import React from 'react';
import './buttonrounded.css';

function ButtonRounded(props) {

    const { variant = 'primary', children, ...rest} = props

    return (
        <button className={`button ${variant}`} {...rest}>
            {children}
        </button>
    )
}

export default Button;
